defaultClubs.description:
The purpose of ASJABSOM and the JABSOM Classes is to serve as the official body representing
the medical students of JABSOM. To that end, purposes include, but are not limited to:
(1) advocating on behalf of the medical students of JABSOM;
(2) promoting the welfare of JABSOM and its students;
(3) fostering student morale;
(4) providing a forum for the expression of student interests and concerns to the faculty,
administration, and staff;
(5) promoting collaboration between the JABSOM Classes;
(6) supporting academic and social interaction among the students, faculty, administration, and the
greater community;
(7) encouraging service in JABSOM and the community;
(8) providing services and activities beneficial to ASJABSOM members, JABSOM, and the
community;
(9) selecting student delegates to JABSOM committees and other bodies with campus-wide
representation; and
(10) directing and regulating the activities of ASJABSOM and the JABSOM Classes.
Notwithstanding any provision of this Constitution, the purposes of ASJABSOM and the JABSOM Classes
are limited exclusively to non-profit purposes.
